SELECT GAGENCIA.NUMBANCO,
       GAGENCIA.NUMAGENCIA,
       GAGENCIA.NOME AS NOME_AGENCIA,
       GBANCO.NOME AS NOME_BANCO,
       GAGENCIA.DIGAG,
       GAGENCIA.PRACA,
       GAGENCIA.CIDADE,
       GAGENCIA.ESTADO
FROM [dbo].GAGENCIA
INNER JOIN [dbo].GBANCO 
ON GAGENCIA.NUMBANCO = GBANCO.NUMBANCO